    false,nt"url": null,nt"notes": "This report covers a biological review
    undertaken in 2007/08 at Banks Lake National Wildlife Refuge. On November 14-15,
    2007, a Biological Review was conducted at Banks Lake National Wildlife Refuge (NWR)
    by a team of managers, biologists, foresters and other resource professionals representing
    state, federal, private, and academic interests. The overall purpose of the Biological
    Review was to examine the appropriate roles the refuge should play regarding wildlife
    and ecosystem conservation and management as viewed from local, community, system,
    and other spatial scales. Based on this examination, a series of recommendations
    were then made with the intent of articulating management and conservation actions
    that refuge staff should consider undertaking in order to fulfill the refuge's conservation
    roles. The Biological Review proper involved on-site visits to view and discuss
    relevant conservation and management issues on Banks Lake NWR, examination and discussion
    of material prepared by refuge staff as part of a Biological Review handbook, and
    numerous presentations and discussions involving key resource professionals representing
    entities with expertise and vested interest in Banks Lake NWR. In general, discussions
    and resulting recommendations were to consider the ecological roles of the refuge
    under ideal circumstances, but participants recognized the need to temper discussions
    through a realistic consideration of obvious management, staffing, and funding constraints.
    Still, some recommendations are more "within reach" than others, and so the recommendations
    herein are not meant to be prescriptive or otherwise binding. They are merely presented
    with the hope of aiding future management as resources become available that assist
    Banks Lake NWR in fulfilling the full extent of its conservation roles in the landscape.
    Further background regarding the purpose and approach of the Biological Review can
    be found in the main body of this report.",nt"license_title": "License Not
